import React from 'react';
import {Routes, Route} from 'react-router-dom';
import Home from './pages/home';
import Client from './pages/client';

export default () => {
    return (
        <Routes>    
            <Route path="/" exact element={<Home />} />  
            <Route path="/city/:id" exact element={<City />} />  
        </Routes>
    )
}
